import React from "react";
import { Link } from "react-router-dom";
import "./style.css";
import Picture from "./brushing_50.png";

function Home() {
    return (
        <div className="row">
            <div className="col-md-6 offset-md-3">
                <img src={Picture} alt="website logo" />
            </div>

            <div className="col-md-6 offset-md-3">
                Hello, this is my about page
            </div>

        </div>


    );

}

export default Home;
